from collections import Counter


def _findAnagrams(s, p):
    lenp = len(p)
    lens = len(s)
    target = Counter(p)
    res = []
    for i in range(lens - lenp + 1):
        if Counter(s[i:i + lenp]) == target:
            res.append(i)
    return res


def findAnagrams(s, p):
    total = lenp = len(p)
    lens = len(s)
    target = Counter(p)
    res = []
    for i in range(lens):
        if target[s[i]] > 0:
            total -= 1
        target[s[i]] -= 1
        if i >= lenp:
            if target[s[i - lenp]] >= 0:
                total += 1
            target[s[i - lenp]] += 1
        if total == 0:
            res.append(i - lenp + 1)
    return res


if __name__ == "__main__":
    print
    findAnagrams("aaabaaa", "aa")
    print
    findAnagrams("abacbabc", "abc")
    print
    findAnagrams("cbaebabacd", "abc")
    print
    findAnagrams("abab", "ab")
    print
    findAnagrams(
        "",
        "")
